import React from 'react'
import { Menu } from 'antd';

function Navbar() {
    return (
            <Menu style={menuStyle} width= "200px" theme="dark"mode="horizontal" defaultSelectedKeys={['1']}>
                <Menu.Item style ={itemStyle}key='1'>Home</Menu.Item>
                <Menu.Item key='2'>About Us</Menu.Item>
                <Menu.Item key='3'>Contact Us</Menu.Item>
            </Menu>
    )
}

let menuStyle={
    width: '40%',
    display: 'flex',
    
}

let itemStyle ={
    color: 'white'
}

export default Navbar;
